import time
from random import randint
from funcs import flag, swap


def quick_sort(array, pivot):
    length = len(array)
    i = 0
    colors = [0, length - 1]
    while i < length and i <= colors[1]:
        if array[i] < pivot:
            if i != colors[0]:
                swap(array, i, colors[0])
            colors[0] += 1
            swappable = colors[0] - 1
        elif array[i] == pivot:
            swappable = i
        else:
            if i != colors[1]:
                swap(array, i, colors[1])
            colors[1] -= 1
            swappable = colors[1] + 1
        if swappable == i:
            i += 1
    return array, colors


def kth(array, k):
    if len(array) == 1:
        return array[0]
    pivot = randint(0, len(array) - 1)
    p = flag(array, array[pivot])[0]
    if p == k:
        return array[p]
    elif p > k:
        return kth(array[:p], k)
    else:
        return kth(array[p + 1:], k - p - 1)


def oil(array):
    return kth(array, len(array) // 2)


